import { useState } from 'react';

const Child = (props) => {
  const [num, setNum] = useState(props.num);
  const countUp = () => {
    setNum((num) => num + 1);
  };
  return (
    <>
      <h3>{`Hello ${num}`}</h3>
      <button onClick={countUp}>+</button>
    </>
  );
};

export default Child;
